Growing up before every summer I would say to myself, “This is the year I am going to lose weight so I won’t dread putting on a swimsuit.” A time of year that is supposed to be filled with sunshine and joy was instead filled with anxiety and the pressure to change my body. 

@Kristinazias and I threw the @confidentcollective summer kick off pool party to say fuck off to all of the pressure to change your body! Over the weekend we invited 150 of YOU to come party with us and celebrate where our bodies are at right in this moment. 

Thank you to everyone who helped make this happen and thank you all for coming! If you couldn’t make it here is a peek at what went down :) 

